import { Box, Button, IconButton } from '@react-native-material/core';
import { useAuth } from '../../hooks/useAuth';
import Icon from '@expo/vector-icons/MaterialCommunityIcons';
import { SafeAreaView } from 'react-native-safe-area-context';
import { NavigationProp, useNavigation } from '@react-navigation/native';

const Home = ({ navigation: { navigate } }) => {
  const { signOut } = useAuth();

  function handleNavigationForm() {
    navigate('Form', { names: ['Brent', 'Satya', 'Michaś'] });
  }

  return (
    <SafeAreaView style={{ flex: 1 }}>
      <Box
        w={'100%'}
        h={'100%'}
        style={{
          flex: 1,
        }}
      >
        {/* Header */}
        <Box
          style={{
            alignItems: 'flex-end',
            paddingHorizontal: 8,
          }}
        >
          <IconButton
            onPress={signOut}
            icon={(props) => <Icon name="logout" {...props} />}
            color="red"
          />
        </Box>

        {/* Main */}
        <Box
          style={{
            flex: 1,
          }}
        ></Box>

        {/* Footer */}
        <Box
          style={{
            alignItems: 'flex-end',
            padding: 8,
            backgroundColor: 'transparent',
          }}
        >
          <IconButton
            onPress={handleNavigationForm}
            icon={(props) => <Icon name="plus" {...props} />}
            color="primary"
            style={{
              backgroundColor: '#dad7e0',
              width: 70,
              height: 70,
            }}
          />
        </Box>
      </Box>
    </SafeAreaView>
  );
};

export default Home;
